import React from 'react'
import { Route, Redirect, Switch } from 'react-router-dom';
import Home from '../home/home';
import AddBook from '../addBook/addBook';
import BookList from '../fetchBooks/bookList';
import EditBook from  '../updateBook/editBook';
import UpdateBookForm from '../updateBook/updateBookForm';

const Routes = (props) => {
    return (
        <div>
            <Switch>
                <Route path="/" exact={true} component={Home}/>

                <Route path="/addbk" component={AddBook}/>

                <Route path="/fetchbk" component={BookList}/>

                <Route path="/editbk/:id" component={EditBook}/>

                <Route path="/updatebk" component={UpdateBookForm}/>

                <Redirect to="/"/>
            </Switch>
        </div>
    );
}
export default Routes;
